import { createGlobalStyle } from "styled-components";

function App() {
  return (
    <>
      <GlobalStyle/>
    </>
  );
}

export default App;

const GlobalStyle = createGlobalStyle`
  *{
    color: white;
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    text-decoration: none;
  }
  body{
    background-color: #333333;
    font-family: "Lato", sans-serif;
  }
`;
